import * as React from 'react';
import './how_works.css';

export class HowWorks extends React.Component {
    constructor(props){
        super(props);
    }
    render() {
        return (
            <div className="container" id="how-works-lab">
                <div className="col-md-5">
                    <h3>{this.props.titulo1}</h3>
                </div>
                <div className="container row textos-lab">
                    <div className="col-md-5 col-12 offset-0 offset-md-0 texto-esquerdo">
                        <p>{this.props.textolateral}</p>
                        <div className="botao-lab">
                            <button type="button" className="button-primary" href="#">Saber mais</button>
                        </div>
                    </div>
                    <div className="col-md-5 col-8 offset-1 itens-lab">
                        <p>{this.props.item1}</p>
                        <p>{this.props.item2}</p>
                        <p>{this.props.item3}</p>
                        <p>{this.props.item4}</p>
                    </div>
                </div>
                <div className="cases-de-sucesso">
                    <div className="col-sm-3 texto-cases">
                        <h4>{this.props.titulo2}</h4>
                    </div>
                    <div className="col-sm-10 logo-startups-lab">
                        <a href="http://mvisia.com.br/" target="#">
                            <img className="logo-mvisia responsive" src={this.props.logo1} alt=""/> {this.props.startup1}
                        </a>
                        <a href="https://www.retinavision.com.br/" target="#">
                            <img className="logo-retina responsive" src={this.props.logo2} alt=""/> {this.props.startup2}
                        </a>
                        <a href="http://flowsense.com.br/" target="#">
                            <img className="logo-flowsense responsive" src={this.props.logo3} alt=""/> {this.props.startup3}
                        </a>
                    </div>
                </div>
            </div>
        )
    }
}
